#include <vector>
#include <string>
#include <sstream>

int main() {
    int t;
    std::cin >> t;
    std::cin.ignore();

    for (int i = 0; i < t; i++) {
        std::vector<long long> a(9);
        std::vector<long long> b(9);

        for (int j = 0; j < 9; j++) {
            std::string s;
            std::getline(std::cin, s);
            std::istringstream iss(s);
            iss >> std::hex >> a[j];
        }

        for (int j = 0; j < 8; j++) {
            b[j] = (a[j] ^ a[j + 8]) % (1LL << 32);
        }

        b[8] = 0;
        for (int j = 0; j < 8; j++) {
            b[8] = (b[8] + b[j]) % (1LL << 32);
        }

        long long k = 0;
        for (int j = 0; j < 32; j++) {
            if ((b[8] >> j) & 1) {
                if ((a[8] >> j) & 1) {
                    k |= 1LL << j;
                }
            }
        }

        std::cout << std::hex << k << std::endl;
    }

    return 0;
}
